import React from "react";

const Table = () => {
  const tab = [{ 1: "A", 2: "B", 3: "C", 4: "D" }];

  return (
    <table>
      <tbody>
          {tab.map(item => 
            <tr>
                <td>{item.key}</td>
            </tr>
            )}
      </tbody>
    </table>
  );
};

export default Table;
